function getJson(newJson, latspec, lonspec) {
    text = JSON.stringify(text1);
    var myJson = JSON.parse(text);

    var len = myJson.length;

    var k = 0;

    for( i = 0; i < len; i++){

        if(myJson[i].size != null){

            newJson[k] = myJson[i];

            k = k+1;

        }

    }

    for( i = 0; i < k; i++){

        newJson[i].lon = parseFloat(newJson[i].lon);

        newJson[i].lat = parseFloat(newJson[i].lat);

    }

    quicksort(newJson,0,k-1,latspec,lonspec)
}

function checker(lat1,lon1,lat2,lon2,latspec,lonspec){
    var distx1 = (lat1-latspec)*110.574;
    var disty1 = (lon1 - lonspec)*111.320*Math.cos((lat1+latspec)*3.1415/360);
    var distx2 = (lat2-latspec)*110.574;
    var disty2 = (lon2 - lonspec)*111.320*Math.cos((lat2+latspec)*3.1415/360);
    var dist1 = distx1*distx1+ disty1*disty1;
    var dist2 = distx2*distx2+ disty2*disty2;
    if(dist1 < dist2) return true;
    else return false;
}


function quicksort(newJson,m,n,latspec,lonspec){
    
    if(m>=n)

        return;

    else{

        var pivot = newJson[n];

        var j = m;

        for(i = m; i<n; i++){

            if(checker(newJson[i].lat,newJson[i].lon,pivot.lat,pivot.lon,latspec,lonspec) == true){

                var tmp = newJson[i];

                newJson[i] = newJson[j];

                newJson[j] = tmp;

                j = j+1;

            }

			

        }

        var tmp = newJson[j];

        newJson[j] = newJson[n];

        newJson[n] = tmp;

        quicksort(newJson,m,j-1,latspec,lonspec);

        quicksort(newJson,j+1,n,latspec,lonspec);

    }

}



